equalheight = function(container){

	var currentTallest = 0,
		 currentRowStart = 0,
		 rowDivs = new Array(),
		 $el,
		 topPosition = 0;
	 $(container).each(function() {
	
	   $el = $(this);
	   $($el).height('auto')
	   topPostion = $el.position().top;
	
	   if (currentRowStart != topPostion) {
		 for (currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++) {
		   rowDivs[currentDiv].height(currentTallest);
		 }
		 rowDivs.length = 0; // empty the array
		 currentRowStart = topPostion;
		 currentTallest = $el.height();
		 rowDivs.push($el);
	   } else {
		 rowDivs.push($el);
		 currentTallest = (currentTallest < $el.height()) ? ($el.height()) : (currentTallest);
	  }
	   for (currentDiv = 0 ; currentDiv < rowDivs.length ; currentDiv++) {
		 rowDivs[currentDiv].height(currentTallest);
	   }
	 });
}

$(window).load(function() {
  equalheight('.box-4');
});


jQuery(function($) {	
	
	// placeholder
	placeHolderFallBack();	
	
	$('ul li:first-child').addClass('first');
	$('ul li:last-child').addClass('last');
	
	$('.list-check-2 li:nth-child(2n)').addClass('break');

	//menu
	$('#menu > li').each(function() {
        $(this).wrapInner('<div class="inner" />');
    });
	$("#menu > li").find("ul").prev().addClass("hasSub");
	$("#menu > li").hover(function(){ 
		if ($(this).find('ul:first').prev().hasClass("expanded")) {
			return false;
		} else {
			$('#menu .expanded').removeClass('expanded');
			$("#menu li").find('ul:first').slideUp();
			$(this).find('ul:first').prev().addClass("expanded");
			$(this).find('ul:first').css({visibility: "visible",display: "none"}).slideToggle(); 
		}  
	}, function(){
		$('#menu .expanded').removeClass('expanded');
		$("#menu li").find('ul:first').slideUp();		
	}); 
	
	
	$(".header-container .ico-user").click(function(e){
		$('.header-container .user').find('ul').slideToggle(400);	
		e.stopPropagation();
		$("html,body").click(function() {
			$('.header-container .user').find('ul').css("display", "none");
		});
	});
	
	// uniform
	$('select, input[type=radio], input[type=checkbox]').uniform();
        $('.upload_doc').uniform();
	
	// gallery photo
	$('#mycarousel').jcarousel();
	$(".thumb").bind('click', $(this), function (e) {
		e.preventDefault();
		$('#mycarousel .jcarousel-item').removeClass('first active');
		$(this).parent().addClass('active');
		$("#img_main").attr('src', $(this).attr('href'));
	});
	
	//fancybox
	$(".various").fancybox({fitToView:false,autoSize:false,autoHeight:true,scrolling : "no",width:620});

	$("input[name='engage']").change(function(){
		var number = $("input[name='engage']:checked").val(),
			current = "#engage" + number;
		$('.search-form .sub-content').hide();
		$(current).show();
	});
	
	$("input[name='ProGlobalEnquiry[rent_type]']").change(function(){
		var number = $("input[name='ProGlobalEnquiry[rent_type]']:checked").val(),
			inviField = "#rentTenant";
        if(number == "Tenant")
		    $(inviField).show();
        else
            $(inviField).hide();
	});
	
});
